import React, { useState, useEffect } from "react";
import { db } from "../firebase";

const DataList = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      const snapshot = await db.collection("data").get();
      const data = snapshot.docs.map((doc) => ({
        id: doc.id,
        ...doc.data(),
      }));
      setData(data);
    };

    getData();
  }, []);

  return (
    <ul>
      {data.map((item) => (
        <li key={item.id}>
          {item.name} - {item.age}
        </li>
      ))}
    </ul>
  );
};

export default DataList;
```

This code uses the `useEffect` hook to fetch data from a collection called `data` in a Firestore database. It then uses the `map` method to convert the document snapshots into an array of objects, each representing a document in the collection. Finally, it uses the `useState` hook to store the data in the `data` state variable and renders the data in a list.
